import React, { useState } from 'react';
import "./info.scss";

const Info = () => {
    const tutorialData = [
        "Welcome to the tutorial! This is page 1.",
        "This is the second page.",
        "Yet another page of information.",
        "And this is the final page!"
    ];

    const [currentPage, setCurrentPage] = useState(0);

    const handleNext = () => {
        if (currentPage < tutorialData.length - 1) {
            setCurrentPage(currentPage + 1);
        }
    };

    const handlePrevious = () => {
        if (currentPage > 0) {
            setCurrentPage(currentPage - 1);
        }
    };

    return (
        <div className='info'>
            <p>{tutorialData[currentPage]}</p>
            <button onClick={handlePrevious} disabled={currentPage === 0}>
                Previous
            </button>
            <button onClick={handleNext} disabled={currentPage === tutorialData.length - 1}>
                Next
            </button>
        </div>
    )
}

export default Info;
